  return (
    <div id="navigation-bar">
      <nav>
        <ul>
          <li><a href="#Home" onClick={() => props.handler(0)}>Home</a></li>
          <div className="dropdown">
            <button className="dropbtn">Projects <span id="Filler">_</span> <i className="arrow down"></i>
            </button>
            <div className="dropdown-content">
              <a href="#Projects" onClick={() => props.handler(1)}>The Court of the Crimson King</a>
              <a href="#Projects" onClick={() => props.handler(1)}>Canvas Dash</a>
              <a href="#Projects" onClick={() => props.handler(1)}>Leinecker's Leins</a>
            </div>
          </div>
          <li><a href="#Personal" onClick={() => props.handler(2)}>Personal</a></li>
        </ul>
      </nav>
    </div>
  );
}

export default TopBar;
